    super(props);
    this.state = {};
  }

  componentWillMount() {
    console.log("Name componentWillMount"); // eslint-disable-line
  }

  render() {
    return (
      <div>
        <p>姓名：{this.props.getValue("name")}</p>
        <p>
          <input
            id="input-name"
            type="text"
            placeholder="输入姓名"
            onChange={this.props.onChange("name")}
            value={this.props.getValue("name")}
          />
        </p>
      </div>
    );
  }
}

